import React from 'react'
import { Avatar, Grid } from '@mui/material'

interface Props {
  alt?: string
  image: string
  sx?: any
}

export default function Icon({ image, alt, ...sx }: Props): JSX.Element {
  return (
    <Grid item xs={12} {...sx}>
      <Avatar alt={alt} src={image} />
    </Grid>

  )
}
